import React, {Component} from 'react'

class TodoApp extends Component {
    render() {
        return (
            <div className="App">
                <LoginComponent/>
            </div>
        )
    }
}

class LoginComponent extends Component {
    constructor(props) {
        super(props)
        this.state = {
            username: 'Enter Your Password',
            password: ' '
        }
        this.handleUsernameChange = this.handleUsernameChange.bind(this)
    }

    handleUsernameChange(event) {
        console.log(event.target.value);

    }

    render() {
        return (
            <div>
            User Name: <input type="text" name="username" value={this.state.username} onChange={handleUsernameChange}/>
            Password: <input type="password" name="passowrd" value={this.state.password}/>
            <button>Login</button>
            </div>
        )
    }
}

export default TodoApp
